import { Component } from '@angular/core';
import { IDENTITY_TABLE, LocalStorageService, NUGGET_TABLE } from './repository/local-storage/local-storage';
import { v4 } from 'uuid';
import { ProfileService } from './repository/api/profile-repository';
import { TrackService } from './repository/api/track-repository';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'mmf-poc';
  nuggets:any[] = [];

  constructor(private localstorageService: LocalStorageService, private profileService: ProfileService, private trackService: TrackService) {
    this.localstorageService.init().then(() => {
      console.log("Created RxDB collections!")
      this.fetchTracks()
    })
  }

  addItem() {
    this.profileService.post({
      id: v4(),
      name: "Name",
      done: true,
      timestamp: Date.now(),
    }).then(() => {
      console.log("Added item")
    });
  }

  addTrack() {
    this.trackService.post({
      id: v4(),
      name: "Name",
      done: true,
      timestamp: Date.now(),
    }).then(() => {
      console.log("Added track")
    });
  }

  sync() {
    this.localstorageService.sync(NUGGET_TABLE)
    this.localstorageService.sync(IDENTITY_TABLE)
  }

  public async fetchTracks() {
    this.trackService.get$().subscribe(changeEvent => {
      console.dir(changeEvent),
      this.trackService.getNuggets().then((value) => {
        console.dir(value)
        this.nuggets = value;
      })
    });
  }
}
